// ==UserScript==
// @name         Rater Hub Helper
// @namespace    http://tampermonkey.net/
// @version      5
// @description  Reminders, reload, auto-submit, and session tracking
// @author       K
// @match        https://www.raterhub.com/evaluation/rater*
// @grant        none
// ==/UserScript==

(function() {
    'use strict';

    // Configurable sounds
    // little big planet notif - https://soundbuttonsworld.com/uploads/2f570251-8b89-42f2-8991-767681be7568.mp3
    const taskAvailableSound = 'data:audio/mp3;base64,';
    const reminderSound = 'data:audio/mp3;base64,';

    // Configurable email webhook (Google Apps Script)
    const emailWebhookURL = '';

    function playSound(url) {
        const audio = new Audio(url);
        audio.play();
    }

    function getCurrentDay() {
        const days = ["sunday", "monday", "tuesday", "wednesday", "thursday", "friday", "saturday"];
        return days[new Date().getDay()];
    }

    function saveSessionTime(day, start, end) {
        const sessions = JSON.parse(localStorage.getItem("aetSessionHistory") || '{}');
        if (!sessions[day]) sessions[day] = [];
        sessions[day].push(`${start} - ${end}`);
        localStorage.setItem("aetSessionHistory", JSON.stringify(sessions));
    }

    function calculateDecimalDuration(startStr, endStr) {
    const parseTime = (str) => {
        const [time, modifier] = str.trim().split(' ');
        let [hours, minutes] = time.split(':').map(Number);
        if (modifier?.toLowerCase() === 'pm' && hours !== 12) hours += 12;
        if (modifier?.toLowerCase() === 'am' && hours === 12) hours = 0;
        return hours * 60 + minutes;
    };

    const startMins = parseTime(startStr);
    const endMins = parseTime(endStr);
    let diffMins = endMins - startMins;

    if (diffMins < 0) diffMins += 1440;

    return diffMins / 60;
    }

    function showStatsPanel() {
    let panel = document.getElementById("aetStatsPanel");
    if (!panel) {
        panel = document.createElement("div");
        panel.id = "aetStatsPanel";
        Object.assign(panel.style, {
            position: "fixed",
            top: "80px",
            right: "20px",
            background: "#fff",
            border: "1px solid #333",
            padding: "20px",
            zIndex: "9999",
            fontSize: "12px",
            maxWidth: "500px",
            maxHeight: "1000px",
            overflowY: "auto",
            boxShadow: "0 0 8px rgba(0,0,0,0.3)",
            whiteSpace: "pre-wrap",
        });
        document.body.appendChild(panel);
    }

    panel.innerHTML = "<strong> Session History</strong><br/><br/>" + formatSessionHistory();
    }

    function formatSessionHistory() {
    const sessions = JSON.parse(localStorage.getItem("aetSessionHistory") || '{}');
    const dayNames = ["Sun", "Mon", "Tue", "Wed", "Thu", "Fri", "Sat"];
    const allEntries = [];

    for (const day in sessions) {
        for (const timeRange of sessions[day]) {
            const [startStr, endStr] = timeRange.split(" - ");
            const date = parseSessionDate(day, startStr);
            const entry = splitMidnightSessions(date, startStr, endStr);
            allEntries.push(...entry);
        }
    }

    allEntries.sort((a, b) => new Date(a.startFull) - new Date(b.startFull));

    const grouped = {};
    for (const s of allEntries) {
        const date = new Date(s.startFull);
        const dateStr = `${date.getMonth() + 1}/${date.getDate()}/${date.getFullYear()} (${dayNames[date.getDay()]})`;
        const timeStr = `${formatTime(date)} - ${formatTime(new Date(s.endFull))}`;

        if (!grouped[dateStr]) grouped[dateStr] = [];
        grouped[dateStr].push(timeStr);
    }

    return Object.entries(grouped).map(([date, times]) => {
        return `<details><summary><strong>${date}</strong></summary><ul style="margin-top:4px;">${
            times.map(t => `<li>${t}</li>`).join("")
        }</ul></details>`;
    }).join("\n") || "No session history found.";
}

    function parseSessionDate(dayName, timeStr) {
    const today = new Date();
    const days = ["sunday", "monday", "tuesday", "wednesday", "thursday", "friday", "saturday"];
    const targetDay = days.indexOf(dayName.toLowerCase());
    const currentDay = today.getDay();
    const diff = targetDay - currentDay;

    const baseDate = new Date(today);
    baseDate.setDate(today.getDate() + diff);
    const [time, meridiem] = timeStr.trim().split(' ');
    let [hour, minute] = time.split(':').map(Number);

    if (meridiem?.toLowerCase() === "pm" && hour !== 12) hour += 12;
    if (meridiem?.toLowerCase() === "am" && hour === 12) hour = 0;

    baseDate.setHours(hour, minute, 0, 0);
    return baseDate;
    }

    function splitMidnightSessions(startDate, startStr, endStr) {
    const entries = [];

    const endDate = new Date(startDate);
    const [endTime, endMeridiem] = endStr.trim().split(' ');
    let [endHour, endMinute] = endTime.split(':').map(Number);

    if (endMeridiem?.toLowerCase() === "pm" && endHour !== 12) endHour += 12;
    if (endMeridiem?.toLowerCase() === "am" && endHour === 12) endHour = 0;

    endDate.setHours(endHour, endMinute, 0, 0);

    if (endDate <= startDate) {
       
        const midnight = new Date(startDate);
        midnight.setHours(23, 59, 59, 999);

        const afterMidnight = new Date(endDate);
        afterMidnight.setDate(afterMidnight.getDate() + 1);

        entries.push({
            startFull: startDate.toISOString(),
            endFull: midnight.toISOString()
        });

        const startNextDay = new Date(midnight);
        startNextDay.setSeconds(1);
        entries.push({
            startFull: startNextDay.toISOString(),
            endFull: endDate.toISOString()
        });
    } else {
        entries.push({
            startFull: startDate.toISOString(),
            endFull: endDate.toISOString()
        });
    }

    return entries;
    }

    function formatTime(date) {
    let hours = date.getHours();
    const minutes = date.getMinutes();
    const ampm = hours >= 12 ? "PM" : "AM";
    hours = hours % 12;
    hours = hours ? hours : 12;
    return `${hours}:${minutes.toString().padStart(2, '0')} ${ampm}`;
    }

    const sessionStart = localStorage.getItem("sessionStart");
    const sessionEnd = localStorage.getItem("sessionEnd");
    showStatsPanel();

    const noTaskXpath = '//*[contains(text(),"No tasks are currently available")]';
    const noTaskNode = document.evaluate(noTaskXpath, document, null, XPathResult.FIRST_ORDERED_NODE_TYPE, null).singleNodeValue;

    if (noTaskNode) {
    localStorage.removeItem("sessionStart");
    localStorage.removeItem("sessionEnd");
    setTimeout(() => location.reload(), 30000);
    return;
    }

    playSound(taskAvailableSound);

    function sendEmailNotification() {
        if (!emailWebhookURL) return;
        fetch(emailWebhookURL, {
            method: "POST",
            body: JSON.stringify({
                subject: " Task Available",
                message: "A new task just appeared! Check: " + location.href
            }),
            headers: {
                "Content-Type": "application/json"
            }
        });
    }
    sendEmailNotification();

    const estNode = document.querySelector('span.ewok-estimated-task-weight');
    let estimatedMinutes = 0;
    if (estNode) {
    const numbers = estNode.textContent.match(/\d+/g)?.map(Number);
    if (numbers?.length) {
        estimatedMinutes = Math.max(...numbers);
    } else {
        return;
    }
    } else {
    return; 
    }

    const dayKey = getCurrentDay();

    const now = new Date();
    const startTime = now.toLocaleTimeString([], { hour: '2-digit', minute: '2-digit' });
    localStorage.setItem("sessionStart", startTime);

    const endTime = new Date(Date.now() + estimatedMinutes * 60000);
    const endTimeStr = endTime.toLocaleTimeString([], { hour: '2-digit', minute: '2-digit' });
    localStorage.setItem("sessionEnd", endTimeStr);

    saveSessionTime(dayKey, startTime, endTimeStr);
    showStatsPanel();
    document.title += ` | Ends: ${endTimeStr}`;

    let notified15s = false;
    let autoSubmitted = false;

    const timerInterval = setInterval(() => {
        const now = Date.now();
        const remaining = endTime - now;

        if (!notified15s && remaining <= 15000 && remaining > 5000) {
            notified15s = true;
            playSound(reminderSound);
        }

        if (!autoSubmitted && remaining <= 5000 && remaining > 0) {
            autoSubmitted = true;
            window.scrollTo(0, document.body.scrollHeight);
            const submitBtn = document.querySelector('button#ewok-task-submit-button');
            if (submitBtn) submitBtn.click();
            clearInterval(timerInterval);
        }
    }, 1000);
})();
